package exam08;

public class DowhileTest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int count = 1;
		
		while(count < 1) {
			System.out.println("실행");
		}
	
		
		do { 
			
			System.out.println("do-while 실행");
			
		}while(count < 1);
	
	}

}
